# dfs solution, works but time limit exceeded, this problem is solved by unique characteristics of the problem itself
class Solution:

    def originalDigits(self, s: str) -> str:
        if not s:
            return ""
        names = ["zero", "one", "two", "three", "four", "five", "six", "seven", "eight", "nine"]

        digit2char2count = []
        digit2len = []
        for digit, name in enumerate(names):
            digit2len.append(len(name))
            char2count = dict()
            for ch in name:
                char2count[ch] = char2count.get(ch, 0) + 1

            digit2char2count.append(char2count)

        char2count = dict()
        for ch in s:
            char2count[ch] = char2count.get(ch, 0) + 1

        def subtract_digit(digit, L):
            d_ch2n = digit2char2count[digit]
            d_len = digit2len[digit]
            if d_len > L:
                return -1

            possible = True
            for ch in d_ch2n:
                leftover_count = char2count.get(ch, 0)
                if leftover_count < d_ch2n[ch]:
                    possible = False
            if not possible:
                return -1

            for ch in d_ch2n:
                char2count[ch] -= d_ch2n[ch]
            return L - digit2len[digit]

        def add_digit(digit):
            d_ch2n = digit2char2count[digit]
            for ch in d_ch2n:
                char2count[ch] += d_ch2n[ch]

        res = []

        def find_res(prev_digit, path, L):
            if L == 0:
                res.append(path)
            if res:
                return

            for digit in range(10):
                if digit < prev_digit:
                    continue
                new_L = subtract_digit(digit, L)
                if new_L >= 0:
                    find_res(digit, path + str(digit), new_L)
                    if res:
                        return
                    add_digit(digit)

        find_res(-1, "", len(s))

        return res[0]


s = Solution()
print(s.originalDigits("fviefuro"))
print(s.originalDigits(
    ""))
